import React from 'react';

const List = (props) => (
        <div style={{padding:0, margin:0, border:'1px solid black'}}>
            <ul style={{padding:'0 0 0 18px', margin:'0 0 10px 0', border:'1px solid red'}}>
                {props.data.filter(listData => (listData.position_id==props.current_id)).map(listData => (
                    <li className='fh_rec_det_resp_req' key={listData.id}>{listData.brief}</li>
                    ))
                }
            </ul>
        </ div>
    )
     
export default List;
